prompt Creating I_DATATABLE...
create table I_DATATABLE
(
  tableid        NUMBER(6) not null,
  tablename      VARCHAR2(100) not null,
  tablememo      VARCHAR2(100) not null,
  serverpath     VARCHAR2(50),
